import { combineReducers } from "redux";
import { iceCreamReducer } from "../ice-cream/ice-cream-reducer";
import { cakeReducer } from "./cake-reducer";

const rootReducer = combineReducers({
	cake: cakeReducer,
	iceCrem: iceCreamReducer,
});

export { rootReducer };
